package collections;

import java.util.*;

public class NonGenericCollections {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		List name = new ArrayList();
		name.add("Anu");
		name.add('a');
		name.add(10);
		System.out.println(name);
		
		
		Set name1 = new HashSet();
		
		name1.add("Anu");
		name1.add('a');
		name1.add(10);
		System.out.println(name1);
	}

}
